import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, SafeAreaView } from 'react-native';

export default function App() {
  const ch1 = require('./assets/chapters/1.json');
  console.log(ch1.text);

  return (
    <SafeAreaView style={styles.container}>
      <Text style={styles.chapter}>1</Text>
      {ch1.text.forEach((line) => {
        console.log(line);
        return <Text style={styles.chapter}>{ch1.text.line}</Text>;
      })}
      )
      <StatusBar style="auto" />
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  chapter: {
    marginTop: 15,
    marginBottom: 15,
    marginLeft: 40,
    marginRight: 40,
  },
});
